import React from 'react';
import './Shelf.css'
import Facing from './Facing';
import Card from '../UI/Card';
const Shelf = (props,index) => {

  console.log(props);


  return (
    <Card className='shelf'>
        <Facing
          key={index}
          shelfID={props.shelf[0].shelfID}
          facingID={props.shelf[0].facingID}
          productUPC={props.shelf[0].productUPC}
          displayFixtureID={props.shelf[0].displayFixtureID}
        />
        <Facing
          key={index}
          shelfID={props.shelf[1].shelfID}
          facingID={props.shelf[1].facingID}
          productUPC={props.shelf[1].productUPC}
          displayFixtureID={props.shelf[1].displayFixtureID}
        />
        <Facing
          key={index}
          shelfID={props.shelf[2].shelfID}
          facingID={props.shelf[2].facingID}
          productUPC={props.shelf[2].productUPC}
          displayFixtureID={props.shelf[2].displayFixtureID}
        />
        <Facing
          key={index}
          shelfID={props.shelf[3].shelfID}
          facingID={props.shelf[3].facingID}
          productUPC={props.shelf[3].productUPC}
          displayFixtureID={props.shelf[3].displayFixtureID}
        />
    </Card>

  );

};

export default Shelf;
